.initEditData(), ...await this.getFormById(id) }\\n        this.initOptions(this.editFormData)\\n        this.editFormData.id = null   //把id设置为空，添加一个新的\\n        <% var tpl = `\\n      {{if element.__config__.children}}\\n        {{each element.__config__.children item}}\\n          {{if (item.__config__.elName == ''ElUploadImage'' || item.__config__.elName == ''ElUploadFile'') && item[''__vModel__'']}}\\n        this.editFormData.{{item[''__vModel__'']}} = null\\n          {{else}}\\n            {{@ item | toCode tpl}}\\n          {{/if}}\\n        {{/each}}\\n      {{/if}}\\n      ` %>\\n      {{@ element | toCode tpl}}\\n    {{if table.hasPassWordInput}}\\n        //TODO 修改加密字段\\n        this.editFormData.loginPasswordUpdate = true   // 允许修改密码\\n    {{/if}}\\n        this.dialogProps.visible = true\\n      })\\n{{/if}}\\n    })\\n  }\\n}\\n</script>\\n","__config__":{"children":[{"__config__":{"elName":"ElDialog","designLayout":"function dialogLayout(h, element, index, parent) {\\n    var slots = {\\n      footerButtonArr: function footerButtonArr(h, conf, key) {\\n        var list = [];\\n        conf.__slot__.footerButtonArr.forEach(function (item) {\\n          list.push(h(\\"el-button\\", {\\n            \\"attrs\\": {\\n              \\"type\\": item.type,\\n              \\"size\\": conf.__config__.size,\\n              \\"disabled\\": item.disabled\\n            }\\n          }, [item.__slot__.default]));\\n        });\\n        if (conf.__config__.footerAlign != ''null'') {\\n          var footerAlign = \\"text-align: \\".concat(conf.__config__.footerAlign);\\n          return h(\\"span\\", {\\n            \\"slot\\": \\"footer\\"\\n          }, [h(\\"div\\", {\\n            \\"style\\": footerAlign\\n          }, [list])]);\\n        } else {\\n          return h(\\"span\\", {\\n            \\"slot\\": \\"footer\\"\\n          }, [list]);\\n        }\\n      }\\n    };\\n    var activeItem = this.$listeners.activeItem;\\n    var config = element.__config