    :field=\\"tableColumns[''139''].field\\"\\n              :title=\\"tableColumns[''139''].title\\"\\n              :width=\\"tableColumns[''139''].width\\"\\n              :visible=\\"tableColumns[''139''].visible\\"\\n              :params=\\"{ sortId: ''139'', summary: false }\\"\\n              tree-node\\n              resizable\\n              min-width=\\"180px\\"\\n              align=\\"left\\"\\n              header-align=\\"center\\"\\n              sortable\\n              show-overflow\\n              class=\\"dc-ux-table-column_ElTableColumn\\"\\n            ></ux-table-column>\\n            <ux-table-column\\n              :field=\\"tableColumns[''140''].field\\"\\n              :title=\\"tableColumns[''140''].title\\"\\n              :width=\\"tableColumns[''140''].width\\"\\n              :visible=\\"tableColumns[''140''].visible\\"\\n              :params=\\"{ sortId: ''140'', summary: false }\\"\\n              tree-node\\n              resizable\\n              min-width=\\"120px\\"\\n              align=\\"right\\"\\n              header-align=\\"center\\"\\n              sortable\\n              show-overflow\\n              class=\\"dc-ux-table-column_ElTableColumn\\"\\n            ></ux-table-column>\\n            <ux-table-column\\n              title=\\"操作\\"\\n              :params=\\"{ sortId: ''119'' }\\"\\n              tree-node\\n              resizable\\n              width=\\"160px\\"\\n              min-width=\\"160px\\"\\n              fixed=\\"right\\"\\n              align=\\"left\\"\\n              header-align=\\"center\\"\\n              class=\\"dc-ux-table-column_ElTableOptColumn\\"\\n            >\\n              <template v-slot:header=\\"scope\\">\\n                <span>操作</span>\\n                <el-popover\\n                  ref=\\"popover\\"\\n                  width=\\"10\\"\\n                  trigger=\\"click\\"\\n                  placement=\\"bottom\\"\\n                  offset=\\"10\\"\\n                  