"search.limit\\"\\n            background\\n            :current-page=\\"tableDataPage\\"\\n            :page-sizes=\\"[10, 20, 30, 40, 50, 100]\\"\\n            layout=\\"total, sizes, prev, pager, next, jumper\\"\\n            v-on:size-change=\\"onSizeChange\\"\\n            v-on:current-change=\\"onCurrentChange\\"\\n            class=\\"dc-el-pagination_ElPagination\\"\\n          ></el-pagination>\\n        </el-row>\\n      </el-main>\\n    </el-container>\\n  </el-row>\\n</template>\\n<script>\\nimport { validatenull } from ''@/utils/validate''\\nimport { listDcMobileSchemePage, deleteDcMobileScheme } from ''@/api/dc/dcMobileScheme''\\n\\nimport { listResourcePermission } from ''@/api/admin/common/permission''\\n/** 根据用户界面配置import组件 开始 */\\nimport History from ''@/views/components/history''\\nimport EditForm from ''./form''\\nimport TplDialog from ''./tplDialog''\\nimport QueryTag from ''@/views/components/queryTag''\\nimport QueryConditionPanel from ''@/views/components/queryConditionPanel''\\nimport { listDcSchemeAll } from ''@/api/dc/dcScheme.js''\\nimport ViewColumnsSelect from ''@/views/components/DcViewColumnsSelect''\\n/** 根据用户界面配置import组件 结束 */\\nimport metadata from ''./metadata''\\nimport ExportExcelButton from ''@/components/ExportExcelButton''\\nimport DcMain from ''@/views/components/dcMain''\\nimport OperationIcon from ''@/components/OperationIcon''\\nimport { downMobile, downMobileScheme } from ''@/api/dc/dcCode''\\nimport { download } from ''@/utils/download''\\nexport default {\\n  extends: DcMain,\\n  components: {\\n    /** 根据用户界面配置组件 开始 */\\n    History,\\n    EditForm,\\n    TplDialog,\\n    QueryTag,\\n    QueryConditionPanel,\\n    ViewColumnsSelect,\\n    /** 根据用户界面配置组件 结束 */\\n    ExportExcelButton,\\n    OperationIcon\\n  },\\n  data() {\\n    return {\\n      permission: {\\n        view: false,\\n        add: false,\\n        edit: false,\\n        remove: false,\\n        export: false\\n      },\\n      metadata,\\n      /** 根据用户界面配置生成data数据 开始 */\\n      parentTable: {},\\n      queryFormData: {\\n        name: '''', // 名称\\n        scheme: {\\n          id: null,\\n          name: null\\n        }\\n      },\\n      tableData: [],\\n      // 查询表格列头\\n      tableColumns: {\\n        132: {\\n          title: ''名称'',\\n          field: ''name'',\\n          visible: true,\\n          order: 0\\n        },\\n        129: {\\n          title: ''是否多租户'',\\n          field: ''project.multilTen'',\\n          visible: false,\\n          order: 1\\n        },\\n        130: {\\n          title: ''项目.状态'',\\n          field: ''project.status'',\\n          visible: false,\\n          order: 2\\n        },\\n        131: {\\n          title: ''项目.名称'',\\n          field: ''project.name'',\\n          visible: false,\\n          order: 3\\n        },\\n        133: {\\n          title: ''后端方案'',\\n          field: ''scheme.name'',\\n          visible: true,\\n          order: 4\\n        },\\n        134: {\\n          title: ''模板'',\\n          field: ''template.name'',\\n          visible: true,\\n          order: 5\\n        },\\n        135: {\\n          title: ''模板json'',\\n          field: ''templateJson'',\\n          visible: false,\\n          order: 6\\n        },\\n        136: {\\n          title: ''备注信息'',\\n          field: ''remarks'',\\n          visible: false,\\n          order: 7\\n        },\\n        137: {\\n          title: ''创建者'',\\n          field: ''createBy'',\\n          visible: false,\\n          order: 8\\n        },\\n        138: {\\n          title: ''创建时间'',\\n          field: ''createDate'',\\n          visible: false,\\n          order: 9\\n        },\\n        139: {\\n          title: ''更新者'',\\n          field: ''updateBy'',\\n          visible: false,\\n          order: 10\\n        },\\n        140: {\\n          title: ''更新时间'',\\n          field: ''updateDate'',\\n          visible: true,\\n          order: 11\\n        },\\n        119: {\\n          title: ''操作'',\\n          width: ''160px'',\\n          visible: true,\\n          order: 12\\n        }\\n      },\\n      // 分页属性\\n      tableDataPage: 1,\\n      tableDataTotal: 0,\\n      // 选项变量\\n      // 后端方案选项\\n      schemeOptions: [],\\n      /** 根据用户界面配置生成data数据 结束 */\\n      version: 11,\\n      search: {\\n        // 查询条件   业务表设置的筛选条件\\n        params: [],\\n\\n        offset: 0,\\n        limit: 10,\\n        columnName: '''', // 排序字段名\\n        order: '''' // 排序\\n      },\\n      searchList: [],\\n      tableId: ''1440433057862000819'',\\n      schemeId: ''1440433057862000817''\\n    }\\n  },\\n  computed: {},\\n  methods: {\\n    getList() {\\n      this.setLoad()\\n      /* 查询参数 和数据权限 */\\n      this.search.params = []\\n\\n      if (validatenull(this.parentTable)) {\\n        this.$alert(''请选择左侧列表'', ''提示'', {\\n          confirmButtonText: ''确定'',\\n          type: ''info''\\n        })\\n        return\\n      }\\n      this.search.params.push({\\n        columnName: ''project_id'',\\n        queryType: ''='',\\n        value: this.parentTable.id\\n      })\\n\\n      if (this.isQueryConditionPanel) {\\n        this.search.params = this.search.params.concat(this.compositeCondition())\\n      } else {\\n        this.search.params.push({\\n          columnName: ''name'',\\n          queryType: ''like'',\\n\\n          value: !validatenull(this.queryFormData.name) ? this.queryFormData.name : null\\n        })\\n\\n        this.search.params.push({\\n          columnName: ''scheme_id'',\\n          queryType: ''='',\\n\\n          value: !validatenull(this.queryFormData.scheme.id) ? this.queryFormData.scheme.id : null\\n        })\\n      }\\n      // 数据权限: 移动端方案dc_mobile_scheme\\n      this.pushDataPermissions(this.search.params, this.$route.meta.routerId, this.tableId)\\n      listDcMobileSchemePage(this.search)\\n        .then((responseData) => {\\n          if (responseData.code == 100) {\\n            this.tableDataTotal = responseData.data.total\\n            this.tableData = responseData.data.rows ? responseData.data.rows : []\\n          } else {\\n            this.showMessage(responseData)\\n          }\\n          this.resetLoad()\\n        })\\n        .catch((error) => {\\n          this.outputError(error)\\n        })\\n    },\\n    onSearch() {\\n      if (this.isQueryConditionPanel) {\\n        this.search.offset = 0\\n        this.tableDataPage = 1\\n        this.getList()\\n      } else {\\n        this.$refs[''queryForm''].validate((valid) => {\\n          if (valid) {\\n            this.search.offset = 0\\n            this.tableDataPage = 1\\n            this.getList()\\n          } else {\\n            return false\\n          }\\n        })\\n      }\\n    },\\n    onSizeChange(val) {\\n      this.tableDataPage = 1\\n      this.search.limit = val\\n      this.search.offset = (this.tableDataPage - 1) * val\\n      this.getList()\\n    },\\n    onCurrentChange(val) {\\n      this.search.offset = (val - 1) * this.search.limit\\n      this.tableDataPage = val\\n      this.getList()\\n    },\\n    async pageInit() {\\n      this.initOptions(this.queryModel)\\n      this.setLoad()\\n      listResourcePermission(this.$route.meta.routerId)\\n        .then((responseData) => {\\n          if (responseData.code == 100) {\\n            this.permission.view = responseData.data.find((item) => {\\n              return item.permission === ''dcMobileScheme:read''\\n            })\\n            this.permission.export = responseData.data.find((item) => {\\n              return item.permission === ''dcMobileScheme:export''\\n            })\\n\\n            this.permission.add = responseData.data.find((item) => {\\n              return item.permission === ''dcMobileScheme:create''\\n            })\\n            this.permission.edit = responseData.data.find((item) => {\\n              return item.permission === ''dcMobileScheme:update''\\n            })\\n            this.permission.remove = responseData.data.find((item) => {\\n              return item.permission === ''dcMobileScheme:delete''\\n            })\\n          } else {\\n            this.showMessage(responseData)\\n          }\\n          this.resetLoad()\\n        })\\n        .catch((error) => {\\n          this.outputError(error)\\n        })\\n    },\\n    onView(scope) {\\n      this.$refs.editForm.$emit(''openViewDialog'', scope.row.id)\\n    },\\n\\n    onCreate() {\\n      if (validatenull(this.parentTable)) {\\n        this.$alert(''请选择左侧列表'', ''提示'', {\\n          confirmButtonText: ''确定'',\\n          type: ''info''\\n        })\\n        return\\n      }\\n      let row = {\\n        project: {\\n          id: this.parentTable.id,\\n\\n          name: this.parentTable.name,\\n\\n          status: this.parentTable.status,\\n\\n          multil_ten: this.parentTable.multil_ten\\n        }\\n      }\\n      this.$refs.tplDialog.$emit(''selectTemplate'', row)\\n    },\\n    onEdit(scope) {\\n      this.$refs.editForm.$emit(''openEditDialog'', scope.row.id)\\n    },\\n    onCopy(scope) {\\n      this.$refs.editForm.$emit(''openCopyDialog'', scope.row.id)\\n    },\\n    afterChangeTpl(clientTpl, dbModel) {\\n      const parant = {\\n        project: this.parentTable\\n      }\\n      this.$refs.editForm.$emit(''openAddDialog'', parant, clientTpl, dbModel)\\n    },\\n    onDelete(scope) {\\n      this.$confirm(''确定删除吗？'', ''确认'', {\\n        confirmButtonText: ''确定'',\\n        cancelButtonText: ''取消'',\\n        type: ''warning''\\n      })\\n        .then(() => {\\n          this.setLoad()\\n          deleteDcMobileScheme(scope.row)\\n            .then((responseData) => {\\n              if (responseData.code == 100) {\\n                this.getList()\\n                this.showMessage({\\n                  type: ''success'',\\n                  msg: ''删除成功''\\n                })\\n              } else {\\n                this.showMessage(responseData)\\n              }\\n              this.resetLoad()\\n            })\\n            .catch((error) => {\\n              this.outputError(error)\\n            })\\n        })\\n        .catch(() => {})\\n    },\\n\\n    onChangeCurrentRow(currentRow, oldCurrentRow) {\\n      if (currentRow != oldCurrentRow) {\\n        this.parentTable = currentRow\\n        this.initOptions(this.queryModel)\\n        this.onSearch()\\n      }\\n    },\\n    onSortChange(orderby) {\\n      if (validatenull(orderby.prop)) {\\n        this.search.columnName = ''''\\n        this.search.order = ''''\\n      } else {\\n        this.search.columnName = orderby.prop\\n        this.search.order = orderby.order === ''descending'' ? ''desc'' : ''asc''\\n      }\\n      this.getList()\\n    },\\n\\n    listSchemeOptions() {\\n      let search_List = {\\n        params: []\\n      }\\n      // filter条件\\n      search_List.params.push.apply(search_List.params, [])\\n\\n      // 数据权限: 低代码-代码方案dc_scheme\\n      this.pushDataPermissions(search_List.params, this.$route.meta.routerId, ''1339746483134570552'')\\n\\n      listDcSchemeAll(search_List).then((responseData) => {\\n        if (responseData.code == 100) {\\n          this.schemeOptions = responseData.data\\n        } else {\\n          this.showMessage(responseData)\\n        }\\n      })\\n    },\\n\\n    // 初始化自定义类型选择框选项变量\\n    initOptions(This) {\\n      this.listSchemeOptions()\\n    },\\n    onDownload() {\\n      this.setLoad()\\n      downMobile(this.parentTable.id)\\n        .then((responseData) => {\\n          download(responseData, this.parentTable.name, ''application/zip;'')\\n          this.resetLoad()\\n        })\\n        .catch((error) => {\\n          this.outputError(error)\\n        })\\n    },\\n    onDownloadScheme(scope) {\\n      this.setLoad()\\n      downMobileScheme(scope.row.id)\\n        .then((responseData) => {\\n          download(responseData, this.parentTable.name, ''application/zip;'')\\n          this.resetLoad()\\n        })\\n        .catch((error) => {\\n          this.outputError(error)\\n        })\\n    }\\n  },\\n  watch: {},\\n  mounted() {\\n    this.pageInit()\\n\\n    this.columnDrop(this.$refs.table)\\n  }\\n}\\n</script>\\n"},{"filePath":"client/src/views/dc//dcMobileScheme","fileName":"form.vue","source":"<template>\\n  <el-row class=\\"dc-container\\">\\n    <tpl-dialog ref=\\"tplDialog\\" v-on:after-change=\\"afterChangeTpl\\" class=\\"dc-tpl-dialog_ElImport\\"></tpl-dialog>\\n    <el-dialog\\n      v-on:open=\\"onDialogOpen\\"\\n      v-on:close=\\"onDialogClose\\"\\n      v-loading=\\"loading\\"\\n      width=\\"100%\\"\\n      fullscreen\\n      :title=\\"dialogProps.title\\"\\n      :visible.sync=\\"dialogProps.visible\\"\\n      :show-close=\\"false\\"\\n      :close-on-click-modal=\\"false\\"\\n      class=\\"code-desinge-dialog\\"\\n    >\\n      <div slot=\\"title\\" class=\\"dialog-header\\">\\n        <el-form ref=\\"editForm\\" :model=\\"editFormData\\" label-width=\\"100px\\" class=\\"edit-form\\">\\n          <el-row>\\n            <el-col :span=\\"12\\">\\n              <el-form-item\\n                prop=\\"name\\"\\n                label=\\"标题\\"\\n                :rules=\\"[{ required: true, message: ''标题不能为空'', trigger: ''blur'' }]\\"\\n                class=\\"dc-el-form-item_SingleInput\\"\\n              >\\n                <el-input\\n                  v-model=\\"editFormData.name\\"\\n                  :maxLength=\\"128\\"\\n                  placeholder=\\"请输入名称\\"\\n                  clearable\\n                  :disabled=\\"action == ''view''\\"\\n                  class=\\"dc-el-input_SingleInput\\"\\n                ></el-input>\\n              </el-form-item>\\n            </el-col>\\n            <el-col :span=\\"12\\">\\n              <el-tooltip v-if=\\"action != ''view''\\" disabled class=\\"dc-el-tooltip_Button\\">\\n                <el-button type=\\"success\\" v-on:click=\\"openTemplateDialog\\" class=\\"dc-el-button_Button\\">更换模板</el-button>\\n              </el-tooltip>\\n              <el-tooltip v-if=\\"action != ''view''\\" disabled class=\\"dc-el-tooltip_Button\\">\\n                <el-button type=\\"primary\\" v-on:click=\\"generate()\\" :disabled=\\"isDesignerDisabled\\" class=\\"dc-el-button_Button\\">\\n                  下载代码\\n                </el-button>\\n              </el-tooltip>\\n              <el-tooltip v-if=\\"action != ''view''\\" disabled class=\\"dc-el-tooltip_Button\\">\\n                <el-button type=\\"primary\\" v-on:click=\\"onSubmit\\" :disabled=\\"!isDesignerDisabled\\" class=\\"dc-el-button_Button\\">\\n                  保存\\n                </el-button>\\n              </el-tooltip>\\n              <el-tooltip disabled class=\\"dc-el-tooltip_Button\\">\\n                <el-button v-on:click=\\"dialogProps.visible = false\\" class=\\"dc-el-button_Button\\">关闭</el-button>\\n              </el-tooltip>\\n            </el-col>\\n          </el-row>\\n        </el-form>\\n      </div>\\n      <div class=\\"code-generator-container\\" :class=\\"settings.size\\" v-if=\\"editFormData.scheme.id && dbModel\\">\\n        <MDesigner\\n          ref=\\"designer\\"\\n          v-if=\\"jsonTpl && jsonTpl.pages && jsonTpl.pages.length > 0 && dbModel\\"\\n          :style=\\"colorObject\\"\\n          v-model=\\"jsonTpl\\"\\n          :dbModel=\\"dbModel\\"\\n          :tplMode=\\"false\\"\\n          class=\\"dc-Designer_ElImport\\"\\n        ></MDesigner>\\n      </div>\\n    </el-dialog>\\n  </el-row>\\n</template>\\n<script>\\nimport { validatenull } from ''@/utils/validate''\\n/** 根据用户界面配置import组件 结束 */\\n{{@ element | makeUpImport | rmDuplicate}}\\n/** 根据用户界面配置import组件 结束 */\\nimport { getExtensionName } from ''@/utils/file''\\nimport { downMobileScheme } from ''@/api/dc/dcCode''\\nimport { getDcSchemeById } from ''@/api/dc/dcScheme''\\nimport { get{{table.className}}ById{{if table.source == ''BASE TABLE''}}, save{{table.className}}{{/if}} } from ''@/api/{{moduleName}}/{{if subModuleName != ''''}}{{subModuleName}}/{{/if}}{{table.className | lowerCase}}''\\nimport BaseUI from ''@/views/components/baseUI''\\nimport OperationIcon from ''@/components/OperationIcon''\\nimport { constructDbModel } from ''../utils''\\nimport { download } from ''@/utils/download''\\nconst renderCode = window[''vue-m-codegenerator''].renderCode\\nconst prettify = window[''vue-m-codegenerator''].prettify\\nconst stringifyTemplate = window[''vue-m-codegenerator''].stringifyTemplate\\nconst parseTemplate = window[''vue-m-codegenerator''].parseTemplate\\nexport default {\\n  extends: BaseUI,\\n  name: ''{{table.className | lowerCase}}-form'',\\n  components: {\\n    /** 根据用户界面配置组件 开始 */\\n    {{@ element | makeUpComponent | rmDuplicate}}\\n    /** 根据用户界面配置组件 结束 */\\n\\n    OperationIcon\\n  },\\n  data() {\\n    return {\\n      /** 根据用户界面配置生成data数据 开始 */\\n      editFormData: this.initEditData(),\\n      jsonTpl: null, // 当前编辑的模板json对象\\n      dbModel: null,\\n      isDesignerDisabled: false, // 生成代码按钮\\n      <%- $imports.makeUpData(element , [{elName:''ElEditForm'', locked: true}]) %>\\n      // 选项变量\\n      {{@ element | makeUpOptions}}\\n      /** 根据用户界面配置生成data数据 结束 */\\n      tplUnwatch: null,\\n      bizUnwatch: null,\\n      // 窗口操作类型 view/edit/add\\n      action: ''''\\n    }\\n  },\\n  props: {\\n    // 权限\\n    permission: {\\n      type: Object\\n    }\\n  },\\n  computed: {\\n    ...Vuex.mapGetters([''settings'']),\\n    colorObject() {\\n      return {\\n        ''--active-color'': this.settings.theme\\n      }\\n    }\\n  },\\n  methods: {\\n    generate() {\\n      // 生成代码\\n      this.setLoad()\\n      downMobileScheme(this.editFormData.id).then((responseData) => {\\n        download(responseData, this.editFormData.project.name, ''application/zip;'')\\n        this.resetLoad()\\n      })\\n      .catch((error) => {\\n        this.outputError(error)\\n      })\\n    },\\n    openTemplateDialog() {\\n      this.$refs.tplDialog.$emit(\\n        ''switchTemplate'',\\n        {\\n          template: this.editFormData.template,\\n          scheme: this.editFormData.scheme\\n        },\\n        this.dbModel\\n      )\\n    },\\n\\n{{if table.source == ''BASE TABLE''}}\\n    onSubmit() {\\n      this.$refs[''editForm''].validate(valid => {\\n        if (valid) {\\n          this.doSave()\\n        } else {\\n          return false\\n        }\\n      });\\n    },\\n    doSave() {\\n      this.setLoad()\\n      if (!validatenull(this.jsonTpl) && !validatenull(this.jsonTpl.pages)) {\\n        let version = 0\\n        if (this.jsonTpl.hasOwnProperty(''version'')) {\\n          // 已存在版本号\\n          version = this.jsonTpl.version\\n        }\\n        this.$set(this.jsonTpl, ''version'', version + 1)\\n        for (let i = 0; i < this.jsonTpl.pages.length; i++) {\\n          this.$set(this.jsonTpl.pages[i], ''version'', version + 1)\\n          const page = this.jsonTpl.pages[i]\\n          let code = renderCode(page.source, {\\n            element:\\n              this.jsonTpl.pages[i].fileName == ''metadata.js''\\n                ? this.jsonTpl.pages.find((item) => item.fileName == ''index.vue'')\\n                : page,\\n            ...this.dbModel\\n          })\\n          code = prettify(getExtensionName(page.fileName), code)\\n          this.$set(this.jsonTpl.pages[i], ''code'', code)\\n        }\\n      }\\n      this.editFormData.templateJson = stringifyTemplate(this.jsonTpl)\\n{{if table.mutilFileUploadExists || table.imageUploadExists}}\\n      let formData = this.createFormData(this.editFormData)\\n      save{{table.className}}(formData).then(responseData => {\\n{{else}}\\n      save{{table.className}}(this.editFormData).then(responseData => {\\n{{/if}}\\n        if(responseData.code == 100) {\\n          this.editFormData.id = responseData.data.id\\n          this.editFormData.updateDate = responseData.data.updateDate\\n          this.isDesignerDisabled = false\\n          this.showMessage({type: ''success'', msg: ''保存成功''})\\n        } else {\\n          this.showMessage(responseData)\\n        }\\n        this.resetLoad()\\n      }).catch(error => {\\n        this.outputError(error)\\n      })\\n    },\\n    switchEdit() {\\n      this.action = ''edit''\\n      this.dialogProps.title = `修改${this.dialogTitle}`\\n      this.initOptions(this.editFormData)\\n    },\\n\\n    {{if table.mutilFileUploadExists || table.imageUploadExists}}\\n    createFormData(editFormData) {\\n      let formData = new FormData()\\n      let deletes = []\\n      <% var tpl = `\\n      {{if element.__config__.children}}\\n        {{each element.__config__.children item}}\\n          {{if (item.__config__.tag == ''upload-file'' || item.__config__.tag == ''upload-image'') && item.__vModel__}}\\n      for(let idx in editFormData.{{item.__vModel__}}File.uploads) {\\n        formData.append(''{{item.__vModel__}}Uploads'', editFormData.{{item.__vModel__}}File.uploads[idx].raw)\\n      }\\n      deletes = deletes.concat(editFormData.{{item.__vModel__}}File.deletes)\\n          {{/if}}\\n          {{@ item | toCode tpl }}\\n        {{/each}}\\n      {{/if}}\\n    ` %>\\n    {{@ element | toCode tpl}}\\n      formData.append(''entity'', JSON.stringify(editFormData))\\n      formData.append(''deleteIds'', JSON.stringify(deletes))\\n      return formData\\n    },\\n    {{/if}}\\n{{/if}}\\n    getFormById(id) {\\n      this.setLoad()\\n      return new Promise((resolve) => {\\n       get{{table.className}}ById(id).then((responseData) => {\\n        let form = {}\\n        if (responseData.code == 100) {\\n          form = responseData.data\\n          this.jsonTpl = parseTemplate(form.templateJson)\\n        } else {\\n          this.showMessage(responseData)\\n        }\\n        this.resetLoad()\\n        resolve(form)\\n      }).catch((error) => {\\n        this.outputError(error)\\n        })\\n      })\\n    },\\n    onDialogClose() {\\n      this.resetWatch()\\n      this.$emit(''save-finished'')\\n    },\\n    onDialogOpen() {\\n      this.$nextTick(() => {\\n        this.$refs[''editForm''].clearValidate()\\n      })\\n    },\\n    <% var tpl = `\\n      {{if element.__config__.children}}\\n        {{each element.__config__.children item}}\\n          {{if item.__config__.tag == ''el-form-item''}}\\n            {{if item.__config__.children[0].__config__.elName === ''SelectInput'' || item.__config__.children[0].__config__.elName === ''CascaderInput'' || item.__config__.children[0].__config__.elName == ''RadioGroup'' || item.__config__.children[0].__config__.elName == ''CheckboxGroup''}}\\n              {{if item.__config__.children[0].__config__.dataType == ''dynamic''}}\\n                {{if item.__config__.children[0].__config__.tag == ''el-cascader''}}\\n    list{{item.__config__.children[0]['':options''] | upperCase}}() {\\n                {{else}}\\n    list{{item.__config__.children[0].__config__.loopArray | upperCase}}() {\\n                {{/if}}\\n      let search_List = {\\n        params: []\\n      }\\n      // filter条件\\n      search_List.params.push.apply(search_List.params, [{{@ item.__config__.children[0].__config__.optionParams}}])\\n      {{if item.__config__.field}}\\n        {{if item.__config__.field.javaType.value == ''Custom''}}\\n      // 数据权限: {{item.__config__.field.customType ? item.__config__.field.customType.comments : ''''}}{{item.__config__.field.customType ? item.__config__.field.customType.name : ''''}}\\n      this.pushDataPermissions(search_List.params, this.$route.meta.routerId, {{@ item.__config__.field.customType ? item.__config__.field.customType.id : '''' | stringify}})\\n        {{else if item.__config__.field.javaType.value == ''This''}}\\n      // 数据权限: {{item.__config__.field.currentTable ? item.__config__.field.currentTable.comments : ''''}}{{item.__config__.field.currentTable ? item.__config__.field.currentTable.name : ''''}}\\n      this.pushDataPermissions(search_List.params, this.$route.meta.routerId, {{@ item.__config__.field.currentTable ? item.__config__.field.currentTable.id : '''' | stringify}})\\n        {{/if}}\\n      {{/if}}\\n      {{item.__config__.children[0].__config__.apiFn}}(search_List).then(responseData => {\\n        if(responseData.code == 100) {\\n          {{if item.__config__.children[0].__config__.tag == ''el-cascader''}}\\n            this.{{item.__config__.children[0]['':options'']}} = responseData.data\\n          {{else}}\\n            this.{{item.__config__.children[0].__config__.loopArray}} = responseData.data\\n          {{/if}}\\n        } else {\\n          this.showMessage(responseData)\\n        }\\n      })\\n    },\\n              {{/if}}\\n            {{/if}}\\n          {{/if}}\\n          {{@ item | toCode tpl }}\\n        {{/each}}\\n      {{/if}}\\n    ` %>\\n    {{@ element | toCode tpl}}\\n    initDbModel(backScheme) {\\n      this.dbModel = null\\n      if (!validatenull(backScheme) && !validatenull(backScheme.id)) {\\n        this.setLoad()\\n        getDcSchemeById(backScheme.id)\\n          .then((responseData) => {\\n            if (responseData.code == 100) {\\n              let schema = responseData.data\\n              if (!validatenull(schema.dcTableList)) {\\n                for (let i = 0; i < schema.dcTableList.length; i++) {\\n                  for (let j = 0; j < schema.dcTableList[i].columnList.length; j++) {\\n                    const childFields = schema.dcTableList[i].columnList[j].childFields\\n                    this.$set(\\n                      schema.dcTableList[i].columnList[j],\\n                      ''childFields'',\\n                      !validatenull(childFields) ? JSON.parse(childFields) : []\\n                    )\\n                  }\\n                }\\n              }\\n              this.dbModel = constructDbModel(schema)\\n            } else {\\n              this.showMessage(responseData)\\n            }\\n            this.resetLoad()\\n          })\\n          .catch((error) => {\\n            this.outp