ble = true\\n      })\\n\\n      this.$on(''openEditDialog'', async function (id) {\\n        this.action = ''edit''\\n        this.dialogProps.title = `修改${this.dialogTitle}`\\n        this.editFormData = {\\n          ...this.initEditData(),\\n          ...(await this.getFormById(id))\\n        }\\n        this.initOptions(this.editFormData)\\n        this.dialogProps.visible = true\\n        this.isDesignerDisabled = false\\n        this.initDbModel(this.editFormData.scheme)\\n        this.setWatch()\\n      })\\n      this.$on(''openAddDialog'', function (parent, clientTpl, dbModel) {\\n        this.action = ''add''\\n        this.dialogProps.title = `添加${this.dialogTitle}`\\n        this.editFormData = {\\n          ...this.initEditData(),\\n          ...parent\\n        }\\n        this.initOptions(this.editFormData)\\n        this.dialogProps.visible = true\\n        this.isDesignerDisabled = true // 不能生成代码\\n        this.jsonTpl = parseTemplate(clientTpl.template.json) // 模板JSON转为对象\\n        this.$set(this.jsonTpl, ''version'', 1)\\n        this.editFormData.templateJson = clientTpl.template.json // 模板JSON\\n        this.editFormData.template = clientTpl.template // 所选模板对象\\n        this.editFormData.scheme = clientTpl.scheme // 所选后端方案\\n        this.editFormData.name = clientTpl.scheme.name\\n        this.dbModel = dbModel\\n        this.setWatch()\\n        // 执行模板初始化JS方法\\n        this.$nextTick(() => {\\n          this.$refs.designer.$emit(''doInitJs'')\\n        })\\n      })\\n      this.$on(''openCopyDialog'', async function (id) {\\n        this.action = ''add''\\n        this.dialogProps.title = `添加${this.dialogTitle}`\\n        this.editFormData = {\\n          ...this.initEditData(),\\n          ...(await this.getFormById(id))\\n        }\\n        this.initOptions(this.editFormData)\\n        this.editFormData.id = null //把id设置为空，添加一个新的\\n\\n        this.dialogProps.visible = true\\n        this.isDesignerDisabled = true // 不能生成代码\\n        this.$set(this.jsonTpl, ''version'', 1)\\n        this.initDbModel(this.editFormData.scheme)\\n        this.setWatch()\\n      })\\n    })\\n  }\\n}\\n</script>\\n<style scoped lang=\\"scss\\">\\n/* var(--active-color) */\\n.item-empty-info {\\n  position: absolute;\\n  top: 50%;\\n  left: 50%;\\n  margin-top: -10px;\\n  margin-left: -63px;\\n  text-align: center;\\n  font-size: 14px;\\n  color: #ccb1ea;\\n  z-index: 2000;\\n}\\n\\n.code-generator-container {\\n  /deep/ .page-opt .drawing-item-plus {\\n    background-color: var(--active-color);\\n  }\\n\\n  /deep/ .right-board {\\n    .document-link {\\n      background-color: var(--active-color);\\n    }\\n  }\\n\\n  /deep/ .drawing-row-item.active-from-item,\\n  /deep/ .drawing-row-item .active-from-item {\\n    border-color: var(--active-color);\\n    outline-color: var(--active-color);\\n  }\\n\\n  /deep/ .drawing-row-item .drawing-item-btns > .drawing-item-icon,\\n  /deep/ .drawing-item .drawing-item-btns > .drawing-item-icon {\\n    background-color: var(--active-color) !important;\\n    border-color: var(--active-color) !important;\\n  }\\n\\n  /deep/ .drawing-item:hover,\\n  /deep/ .drawing-row-item:hover {\\n    outline-color: var(--active-color);\\n  }\\n}\\n</style>\\n"},{"filePath":"client/src/views/dc//dcMobileScheme","fileName":"metadata.js","source":"      <% var tpl = `\\r\\n      {{if element.__config__.children}}\\r\\n        {{each element.__config__.children item}}\\r\\n          {{if item.__config__.elName == ''ElConditionPanel'' && item.__config__.locked}}\\r\\n            const conditions = [\\r\\n            {{if null != item.__config__.searchList && item.__config__.searchList.length > 0}}\\r\\n              {{each item.__config__.searchList search}}\\r\\n              {\\r\\n                name: ''{{search.name}}'',\\r\\n                comments: ''{{search.comments}}'',\\r\\n                tag: ''{{search.tag}}'',\\r\\n                queryType: ''{{search.queryType}}'',\\r\\n                